func TestNoErrorWithExampleFile(t *testing.T) {
	xodrData := []byte(ExampleXodr)
	openDrive := OpenDrive{}
	err := ParseOdrXml(xodrData, &openDrive)
	if err != nil {
		t.Error("ERROR", err)
	}
	_, err = ToPoints(&openDrive)
	if err != nil {
		t.Error("ERROR", err)
	}
}

